function _returnComplexDate() {
    /// <summary>This method returns a string with the current date value in the format yyyymmddms.</summary>
    var d = new Date();
    return "" + d.getFullYear() + "" + (d.getMonth() + 1) + "" + d.getDate() + "" + d.getMilliseconds();
}
